Failures in VarargsTest and GenericTypeTest are again caused by Iterator.remove() having an implementation now. (comment 0 should've said Iterator, too, List.remove() is not part of the game).
Failures in JavadocTestForClass report problems like:
public interface X extends Map { ^ The return types are incompatible for the inherited methods MapStream.values(), Map.values()
Type MapStream is new in 1.8, it declares:
Iterable<V> values();
Now Map says:
public interface Map<K,V> extends MapStream<K, V> { ... Collection<V> values();
Given that Collection<E> extends Iterable<E> this should be a legal covariant override. Looks like a bug in our compiler to complain if an interface just tries to extend Map<#RAW>.

(In reply to comment #18) > b. change existing interface methods into default methods
I just noticed that my previous example was slightly off, here is the corrected example:
Method java.util.Iterator#remove().
Java7: void remove();
Java8-lambda: void remove() default { throw new UnsupportedOperationException("remove"); }
To illustrate my point in comment 18: If we could rule out this kind of introduction we *could* say: if in 1.7- mode we see - a non-abstract interface method - a class that implements the interface but does not implement this method we could classify this as an "unavoidable compatibility issue" and allow to downgrade this to warning or ignore (assuming the default method doesn't exist in the 1.7 target platform). However, due to examples like the above it would be wrong to downgrade, because on the intended target platform this interface method exists as an abstract method and not implementing it is a definite error.
